import QuickNote from "../UI/QuickNote"

const QuickNotesBlock = (props) =>{

    return(<div className='QuickNotesBlock'>
        <div></div>
        <Addqn notesInQuickNotes={props.notesInQuickNotes}/>
        <div></div>
        {props.notesInQuickNotes.map(note=><QuickNote value={note.text}/>)} 
    </div>)

}

export default QuickNotesBlock
